int model_predict(data_t input, flatten_data_t * results){
    data_t output;
    flatten_data_t f_input;

    // Input
    #if PRINT_RESULTS==1
        Serial.println("Datos de entrada: ");
        print_data_t(input);
    #endif
  
  // Capa 1: Conv 2D
    conv2d_layer(conv_layer0,input,&output);    // Aplicar la convolución  de la capa
    #if PRINT_RESULTS == 1
        Serial.println("Matriz output capa 1 (Conv 2D): ");
        print_data_t(output);
    #endif
    relu(output);                           // Activación Capa ?: relu
    #if PRINT_RESULTS == 1
        Serial.println("Activacion capa 1 (Relu): ");
        print_data_t(output);
    #endif
  //free(input.data);
  input=output;
  
  // Capa 2: MaxPooling2D
  max_pooling_2d(2,input,&output);
    #if PRINT_RESULTS == 1
      Serial.println("Matriz output capa 2 (MaxPooling 2D): ");
      print_data_t(output);
    #endif
  //free(input.data);
  input=output;
  
  // Capa 3: Flatten
    flatten_data_t f_output;
    flatten_layer(output, &f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Vector output capa 3 (Flatten): ");
        print_flatten_data_t(f_output); 
    #endif
    //free(output.data);
    f_input=f_output;
  // Capa 4: Dense
    dense_forward(dense_layer0,f_input,&f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Vector output capa 4 (Dense): ");
        print_flatten_data_t(f_output);
    #endif
    //free(f_input.data);
  
    //Activación Capa 4: relu
    relu_flatten(f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Activacion capa 4 (Relu): ");
        print_flatten_data_t(f_output);
    #endif
    f_input = f_output;
    
  // Capa 5: Dense
    dense_forward(dense_layer1,f_input,&f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Vector output capa 5 (Dense): ");
        print_flatten_data_t(f_output);
    #endif
    //free(f_input.data);
  
    //Activación Capa 5: softmax
    softmax(f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Activacion capa 5 (Softmax): ");
        print_flatten_data_t(f_output);
    #endif
    
  int result= argmax(f_output);
  *results = f_output;
  return result;
}
  
